import React from 'react';

function About() {
  return (
    <div className="about">
      <h2>About Us</h2>
      <p>We are a team of experienced IT Solutions Architects dedicated to helping businesses optimize their technology infrastructure.</p>
    </div>
  );
}

export default About;
